import React, { useEffect } from "react";
import { useFormAdmin, Form } from "../../../components/useFormAdmin";
import { Grid, } from '@material-ui/core';
import Controls from "../../../components/controls/Controls";
import * as adminService from "../../../services/adminService";
import { useState } from "react";


// const genderItems = [
//     { id: 'action_sur_admins', title: 'Crer et modifier sous-admin' },
//     { id: 'action_sur_associations', title: 'Creer et modifier association' },
//     { id: 'action_sur_membres', title: 'Creer et modifier membre-association' },
// ]

const initialeValues = {
    eglise: '',
    zone:'',
    region:'',
    cota:'',
    name: '',
    telephone: '',
    username: '',
    password: '',
    autorisation: '',

}

export default function TransferForm(props) {
    const { addOrEdit, recordForEdit } = props;
    const [currentUser, setCurrentUser] = useState(adminService.getCurrentUser());
    
    const validate = (fieldValues = values) => {
        let temp = { ...errors }
        if ('eglise' in fieldValues)
            temp.eglise = fieldValues.eglise ? "" : "This field is required."
        if ('zone' in fieldValues)
            temp.zone = fieldValues.zone ? "" : "This field is required."
        if ('region' in fieldValues)
            temp.region = fieldValues.region ? "" : "This field is required."
        if ('cota' in fieldValues)
            temp.cota = fieldValues.cota ? "" : "This field is required."
        if ('name' in fieldValues)
            temp.name = fieldValues.name ? "" : "This field is required."
        if ('telephone' in fieldValues)
            temp.telephone = fieldValues.telephone.length > 9 ? "" : "Minimum 10 numbers required."
        if ('username' in fieldValues)
            temp.username = fieldValues.username ? "" : "Email is not valid."
        if ('password' in fieldValues)
            temp.password = fieldValues.password ? "" : "This field is required."
        if ('autorisation' in fieldValues)
            temp.autorisation = fieldValues.autorisation ? "" : "This field is required."
        setErrors({
            ...temp
        })

        if (fieldValues === values)
            return Object.values(temp).every(x => x === "")
    }

    const handleSubmit = e => {
        e.preventDefault()
        if (validate()) {
            addOrEdit(values, resetForm);
        }
    }
    const {
        values,
        setValues,
        errors,
        setErrors,
        handleInputChange,
        resetForm
    } = useFormAdmin(initialeValues, true, validate);

    useEffect(() => {
        if (recordForEdit !== null)
            setValues({
                ...recordForEdit
            })
    }, [recordForEdit])


    return (
        <Form onSubmit={handleSubmit}>
            <Grid container>
                <Grid item xs={6}>
                    <Controls.Input
                        name="eglise"
                        label="Eglise Local"
                        value={values.eglise}
                        onChange={handleInputChange}
                        error={errors.eglise}
                    />
                    <Controls.Input
                        label="Montant Cotisation"
                        name="cota"
                        value={values.cota}
                        onChange={handleInputChange}
                        error={errors.cota}
                    />
                    <Controls.Input
                        label="Nom & prenom"
                        name="name"
                        value={values.name}
                        onChange={handleInputChange}
                        error={errors.name}
                    />
                    <Controls.Input
                        name="telephone"
                        label="Telephone"
                        value={values.telephone}
                        onChange={handleInputChange}
                        error={errors.telephone}
                    />
                    <Controls.Select
                        label="Role"
                        name="autorisation"
                        value={values.autorisation}
                        onChange={handleInputChange}
                        options={adminService.getAutorisation()}
                        error={errors.autorisation}
                    />
                </Grid>
                <Grid item xs={6}>
                    <Controls.Input
                        name="username"
                        label="Nom utilisateur"
                        value={values.username}
                        onChange={handleInputChange}
                        error={errors.username}
                    />
                    <Controls.Input
                        name="password"
                        type="password"
                        label="Mot de passe"
                        value={values.password}
                        onChange={handleInputChange}
                        error={errors.password}
                    />
                    <Controls.Input
                        name="zone"
                        label="Zone"
                        value={values.zone}
                        onChange={handleInputChange}
                        error={errors.zone}
                    />
                    <Controls.Input
                        name="region"
                        label="Region"
                        value={values.region}
                        onChange={handleInputChange}
                        error={errors.region}
                    />
                    <div>
                        <Controls.Button
                            type="submit"
                            text="VALIDATION" />
                        <Controls.Button
                            text="REDEFINIR"
                            color="default"
                            onClick={resetForm} />
                    </div>
                </Grid>
            </Grid>
        </Form>
    )
}
